void end_game_ini(); // 预留接口，主要作用是可以后期加装最高分，等数据
                     // 目前没有定义会出现的问题是： 用户在上一局的分数会得到继承

int main(void)
{

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer

    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen();                             // pixel_buffer_start points to the pixel buffer

    while (1)
    {
        // 这是游戏开始界面
        welcome_page();

        // Instruction界面
        instruction_page();

        // 难度选择界面
        countdown = config_count_down(difficulty_select());

        // 这是游戏本体
        main_canvas();

        // 结束界面
        end_page();

        // 处理游戏信息
        end_game_ini();
    }
}
void end_game_ini()
{
    user_loc_x = 150;
    user_loc_y = 110;
    size = 15;
    speed = 4;
    score = 0;
    countdown = 0;
    a.x = 180;
    a.y = 180;
    a.size = 10;
    npc_eaton = 0;
    det = 1;
}

void instruction_page()
{

    draw_instruction_page();

    int ps2_data;
    char read_exist;
    unsigned char key_pressed;
    key_pressed = 0;

    int detect = 0;
    while (detect == 0)
    {
        ps2_data = *(ps2);
        read_exist = ((ps2_data & 0x8000) != 0);

        if (read_exist)
        {

            key_pressed = (ps2_data & 0xFF);

            if (key_pressed == 0x5A)
            {
                detect = 3;
            }
            else
            {
            }
        }
    }

    erase_instruction_page();
}

void draw_instruction_page()
{

    int count = 0;
    for (int y = 0; y < RESOLUTION_Y; y++)
    {
        for (int x = 0; x < RESOLUTION_X; x++)
        {
            // plot_pixel(x, y, GREEN);
            plot_pixel(x, y, instruction_image[count]);
            count++;
        }
    }

    wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
}

void erase_instruction_page()
{

    clear_screen();
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen();
    wait_for_vsync();
}

// 结束界面
void end_page()
{
    draw_end_page();

    int value = 0;
    while (value == 0)
    {
        volatile int *SW = (int *)0xFF200040;
        register int sw_det = *SW;
        if ((sw_det & 0x02) != 0)
        {
            value = 1;
        }
    }

    erase_end_page();
}

