// 主界面
void main_canvas()
{

    while (program_guard())
    {

        // 实时显示速度和分数
        speed_display();
        score_seg_display();

        // 擦掉之前的东西
        erase();
        npc_touch_erase();

        pixel_buffer_start = *pixel_ctrl_ptr;

        // 画新的东西
        draw_current_user(user_loc_x, user_loc_y, check_direction(), size); // 画蓝方块
        draw_static_fish(a);

        wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
}

// NPC接触判断逻辑
void npc_touch_erase()
{
    if (check_contact(a)) // 如果说没碰到，而且没擦过，就擦
    {
        npc_eaton++;

        erase_fish();
        pixel_buffer_start = *pixel_ctrl_ptr;
        erase_fish();
        size += 1;
        if (npc_eaton != 9)
        {
            a.size = 10;
            // a.x -= 20;
            // a.y -= 20;

            a.x = rand() % 160 + 40;
            a.y = rand() % 120 + 40;
        }
        else
        {
            a.x = 200;
            a.y = 200;
        }

        det = rand() % 4;

        score++;
        // 每四个就慢一点，会变胖
        if (score % 4 == 0)
        {
            speed--;
        }

        kill_sound();
    }
}

// 程序截止器
bool program_guard()
{
    if (timer_interrupt())
    {
        set_timer(1);
        countdown--;
        displayHex_clock(countdown);
    }

    if (countdown == 0)
    {
        return false;
    }
    return true;
}

// 计时器config
int config_count_down(int difficulty)
{
    int countdown = 0;
    if (difficulty == 1)
    {
        countdown = 60;
    }
    else if (difficulty == 2)
    {
        countdown = 30;
    }
    else
    {
        countdown = 20;
    }

    return countdown;
}

// 难度选择界面
int difficulty_select()
{

    draw_select_page();

    int ps2_data;
    char read_exist;
    unsigned char key_pressed;
    key_pressed = 0;

    int difficulty = 0;
    while (difficulty == 0)
    {
        ps2_data = *(ps2);
        read_exist = ((ps2_data & 0x8000) != 0);

        if (read_exist)
        {

            key_pressed = (ps2_data & 0xFF);

            if (key_pressed == 0x15)
            { // Q
                difficulty = 1;
            }
            else if (key_pressed == 0x1D)
            { // W
                difficulty = 2;
            }
            else if (key_pressed == 0x24)
            { // R
                difficulty = 3;
            }
            else
            {
                // 啥都别干
            }
        }
    }

    erase_select_page();
    return difficulty;
}

