// 计时器控制
bool timer_interrupt()
{
    short interrupt = *(timer + 3);

    if (interrupt != 0)
    {
        *(timer + 3) = 0b1; // 复位
        return true;
    }

    return false;
}

// 击杀声音
void kill_sound()
{

    int duration = 500;

    for (int i = 0; i < duration; i++)
    {

        int sound = *(audio_ptr + 3);
        *(audio_ptr + 2) = sound;
        *(audio_ptr + 3) = sound;
    }
}

void set_timer(int seconds)
{
    *(timer) = 200000000 * seconds; // 选要多少时间
    *(timer + 2) = 0b0001;          // 开始用
}

// 两位数倒计时
void displayHex_clock(int total_time)
{

    int second = (total_time) % 10;
    int ten_second = total_time / 10;

    int to_display = (hex_seg_from_dec(ten_second) << 8) | (hex_seg_from_dec(second));

    *(count_down_hex) = to_display;

    return;
}

int hex_seg_from_dec(int decimal_num)
{
    int seg_code_in_hex = 0;

    if (decimal_num == 0)
    {
        seg_code_in_hex = 0x3F;
    }
    else if (decimal_num == 1)
    {
        seg_code_in_hex = 0x06;
    }
    else if (decimal_num == 2)
    {
        seg_code_in_hex = 0x5B;
    }
    else if (decimal_num == 3)
    {
        seg_code_in_hex = 0x4F;
    }
    else if (decimal_num == 4)
    {
        seg_code_in_hex = 0x66;
    }
    else if (decimal_num == 5)
    {
        seg_code_in_hex = 0x6D;
    }
    else if (decimal_num == 6)
    {
        seg_code_in_hex = 0x7D;
    }
    else if (decimal_num == 7)
    {
        seg_code_in_hex = 0x07;
    }
    else if (decimal_num == 8)
    {
        seg_code_in_hex = 0x7F;
    }
    else if (decimal_num == 9)
    {
        seg_code_in_hex = 0x67;
    }

    return seg_code_in_hex;
}

