// 接触判断逻辑
bool check_contact(NPC thisnpc)
{

    if (user_loc_x < thisnpc.x + thisnpc.size && user_loc_x + size > thisnpc.x && user_loc_y < thisnpc.y + thisnpc.size && user_loc_y + size > thisnpc.y)
    {
        return true;
    }
    return false;
}

// 绘制NPC
void draw_static_fish(NPC thisnpc)
{
    int count = 0;
    fish_erase_count = 0;
    for (int i = thisnpc.x; i < thisnpc.x + thisnpc.size; i++)
    {
        for (int j = thisnpc.y; j < thisnpc.y + thisnpc.size; j++)
        {

           //int det = rand() % 4;

            if(det == 0){
                plot_pixel(i, j, npc_one[count]); 
            } else if (det == 1){
                plot_pixel(i, j, npc_two[count]); 
            }else if (det == 2){
                plot_pixel(i, j, npc_three[count]); 
            }else {
                plot_pixel(i, j, npc_four[count]); 
            }
           
            fish_erase_x[fish_erase_count] = i;
            fish_erase_y[fish_erase_count] = j;
            fish_erase_count++;
            count++;
        }
    }
}

// 摁键处理程序
int check_direction()
{
    int return_code = 0;
    register int key_det = *KEY;

    if ((key_det & 0x01) != 0)
    {
        return_code = 1;
    }
    else if ((key_det & 0x02) != 0)
    {
        return_code = 2;
    }
    else if ((key_det & 0x04) != 0)
    {
        return_code = 3;
    }
    else if ((key_det & 0x08) != 0)
    {
        return_code = 4;
    }

    return return_code;
}

